import { useState } from 'react';

export default function CreateProduct() {
  const [name, setName] = useState('Wes');
  const [price, setPrice] = useState(100);
  return (
    <form>
      <label htmlFor="name">
        Name
        <input
          type="text"
          id="name"
          name="name"
          placeholder="Name"
          value={name}
          onChange={(e) => {
            console.log(e.target.value);
            setName(e.target.value);
          }}
        />
      </label>
      <label htmlFor="price">
        price
        <input
          type="text"
          id="price"
          name="price"
          placeholder="price"
          value={price}
          onChange={(e) => {
            console.log(e.target.value);
            setPrice(e.target.value);
          }}
        />
      </label>
    </form>
  );
}
